import React from 'react'

import './Section4.scss';

const Section4 = () => {
    return (
        <div className="s4_container">
            <div className="s4_box">
                <p className="s4_box_heading">Shop Our Gram</p>
                <div className="s4_card_box">
                    CARDS
                </div>
            </div>
        </div>
    )
}

export default Section4;
